package com.mzth.createcause.entity;/** * Created by Administrator on 2017/10/11 0011. */public class ExtractEntity {    private int select;    private int img;    private String name;    private String number;    public int getSelect() {        return select;    }    public void setSelect(int select) {        this.select = select;    }    public int getImg() {        return img;    }    public void setImg(int img) {        this.img = img;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getNumber() {        return number;    }    public void setNumber(String number) {        this.number = number;    }}